import React, { Fragment } from 'react';
import { BrowserRouter, Route } from "react-router-dom";

import './App.css';
import Header from "../Header";
import Content from "../Content";
import Footer from "../Footer";

const App = () => {
  return (
      <Fragment>
          <BrowserRouter>
            <Header />
            <Content />
            <Route path="/Footer" component={Footer}/>
          </BrowserRouter>
      </Fragment>
  );
};

export default App;
